import React from 'react';

const Form = () => {
    return (
        <>
            <div className="formBox">
                <form>
                    <label>Name</label><br />
                    <input type="text" name="name" placeholder="Enter your Name" />
                    
                    <br /><br/>
                    
                    <label>Email</label><br />
                    <input type="email" name="email" placeholder="Enter your Email" />
                    
                    <br /><br/>


                </form>
            </div>
        </>
    )
}

export default Form;
